// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

import "./BaseStructs.sol";
import "./Pool/AvatarPool.sol";
import "./Pool/StonePool.sol";
import "./Pool/WearablePool.sol";
import "./../Season.sol";

import "@openzeppelin/contracts/token/ERC721/ERC721.sol";
import "@openzeppelin/contracts/token/ERC721/extensions/ERC721Enumerable.sol";
import "@openzeppelin/contracts/token/ERC721/extensions/ERC721URIStorage.sol";
import "@openzeppelin/contracts/access/Ownable.sol";
import "@openzeppelin/contracts/token/ERC20/ERC20.sol";
import "@openzeppelin/contracts/utils/Strings.sol";


contract NFTManager is BaseStructs, Ownable {
    
    uint256 totalQuantityToBeMinted;

    mapping(uint256 => Stone)  public StoneList;
    mapping(uint256 => Wearable)  public WearableList;


    // ADDRESS
    address private avatarPoolAddress;
    address private StonePoolAddress;
    address private WearablePoolAddress;

    address private BoxAddress;
    address private SeasonAddress;

    // SET BASE INFO
    uint256 baseIDNFTCounter = 1;



    function setAvatarPoolAddress(address _avatarPoolAddress) public onlyOwner { avatarPoolAddress = _avatarPoolAddress; }
    function setStonePoolAddress(address _StonePoolAddress) public onlyOwner { StonePoolAddress = _StonePoolAddress; }
    function setWearablePoolAddress(address _WearablePoolAddress) public onlyOwner { WearablePoolAddress = _WearablePoolAddress; }

    function setBoxAddress(address _BoxAddress) public onlyOwner { BoxAddress = _BoxAddress; }
    function setSeasonAddress(address _SeasonAddress) public onlyOwner { SeasonAddress = _SeasonAddress; }


    constructor (
        address _avatarPoolAddress,
        address _StonePoolAddress,
        address _WearablePoolAddress,

        address _BoxAddress, 
        address _SeasonAddress
    ) {
        avatarPoolAddress = _avatarPoolAddress;
        StonePoolAddress = _StonePoolAddress;
        WearablePoolAddress = _WearablePoolAddress;

        BoxAddress = _BoxAddress;
        SeasonAddress = _SeasonAddress;
    }






    /**
        This function permit to user and BoxAddress smart contract to mint NFT
    
        LEGGEND:
            objKey == 0     AVATAR
            objKey == 1     STONE
            objKey == 2     WEARABLES
     */
    function NFTSafeMint ( 
        address to, 
        uint256 tokenRarity, 
        uint256 objKey
    ) public payable returns(bool) {
        require(msg.sender == BoxAddress, "You can not call this function");

        uint256 season = Season(SeasonAddress).getCurrentSeason();

        if (objKey == 0) require( AvatarPool(avatarPoolAddress).getAvatarPoolInfo(season, tokenRarity).quantity > 0, "No one nft free in this season for this rarity");
        else if (objKey == 1) require( StonePool(StonePoolAddress).getStonePoolInfo(season, tokenRarity).quantity > 0, "No one nft free in this season for this rarity");
        else if (objKey == 2) require( WearablePool(WearablePoolAddress).getWearablePoolInfo(season, tokenRarity).quantity > 0, "No one nft free in this season for this rarity");
        else return false;

        if (msg.sender == BoxAddress) { 
        
            if (objKey == 0) return AvatarPool(avatarPoolAddress).mintingPrivate(tokenRarity, season, to, "Avatar"); 
            else if (objKey == 1) return StonePool(StonePoolAddress).mintingPrivate(tokenRarity, season, to, "Stone");
            else if (objKey == 2) return WearablePool(WearablePoolAddress).mintingPrivate(tokenRarity, season, to, "Wearable");
            else return false;
        
        } else {

            if (objKey == 0) {
                require( msg.value >= AvatarPool(avatarPoolAddress).getAvatarPoolInfo(season, tokenRarity).cost, "Try to check the price of NFT Avatar" );
                return AvatarPool(avatarPoolAddress).mintingPrivate(tokenRarity, season, msg.sender, "Avatar");
            } else if (objKey == 1) {
                require( msg.value >= StonePool(StonePoolAddress).getStonePoolInfo(season, tokenRarity).cost, "Try to check the price of NFT Stone" );
                return StonePool(StonePoolAddress).mintingPrivate(tokenRarity, season, msg.sender, "Stone");
            } else if (objKey == 2) {
                require( msg.value >= WearablePool(WearablePoolAddress).getWearablePoolInfo(season, tokenRarity).cost, "Try to check the price of NFT Wearable" );
                return WearablePool(WearablePoolAddress).mintingPrivate(tokenRarity, season, msg.sender, "Wearable");
            } else return false;

        }
    }
    
}
